Here's a JavaScript function that switches the order of adjectives in a sentence:

```javascript
function switchAdjectives(sentence) {
  // Split the sentence into an array of words
  const words = sentence.split(" ");

  // Find the index of the first adjective
  let adjectiveIndex = -1;
  for (let I = 0; I < words.length; i++) {
    const word = words[i];
    if (isAdjective(word)) {
      adjectiveIndex = i;
      break;
    }
  }

  // If there is no first adjective, return the original sentence
  if (adjectiveIndex === -1) {
    return sentence;
  }

  // Swap the positions of the first and second adjectives
  const firstAdjective = words[adjectiveIndex];
  const secondAdjective = words[adjectiveIndex + 1];
  words[adjectiveIndex] = secondAdjective;
  words[adjectiveIndex + 1] = firstAdjective;

  // Join the modified array back into a sentence
  return words.join(" ");
}

// Helper function to check if a word is an adjective
function isAdjective(word) {
  return /\A[a-z]+[^-\s]+\z/.test(word);
}

// Example usage:
const sentence = "Beautiful green trees are in the park";
const result = switchAdjectives(sentence);
console.log(result); // Output: "Green beautiful trees are in the park"
```

The `switchAdjectives()` function works by finding the index of the first adjective in the sentence using a loop. It then swaps the positions of the first and second adjectives and returns the modified sentence. The `isAdjective()` helper function is used to check whether a given word is an adjective based on a simple regular expression pattern. This helps avoid swapping nouns or other parts of speech that shouldn't be switched.

