% Define kernel for Gaussian filter (5x5)
gaussian_kernel = fspecial('gaussian', [5 5], 0.5);

% Apply Gaussian filter
blurred_image = filter(gaussian_kernel, gray_image, 'replicate');

% Define Sobel operators in x and y directions
sobel_x = [-1 0 1; -2 0 2; -1 0 1];
sobel_y = [-1 -2 -1; 0 0 0; 1 2 1];

