```js
function validateUrl(url) {
  const regexPattern = new RegExp(/^https?:\/\/[^\s$<>]+$/);
  return regexPattern.test(url);
}

// Using the auto-prefixed version
const prefix = '/';
const regexPattern = new RegExp(prefix + '(^https?:\\/\\/[^\\s$<>]+$)');
