Here's an example of a logical syllogism:

Premise 1 (major): All men are mortal (M)
Premise 2 (minor): Socrates is a man (m)
Conclusion: Therefore, Socrates is mortal (λ)

This is known as Modus Ponens, which is the most common form of syllogism. It's called a "syllogism" because it consists of three statements: two premises and a conclusion. The first statement, called the major premise, makes a general claim about a group (in this case, all men). The second statement, called the minor premise, makes a specific claim about a particular individual (Socrates). The conclusion then follows logically from these two statements.

The symbol M represents the set of all mortal things, and m represents the set containing Socrates. Since m is a subset of M, we can conclude that everything in m (i.e., Socrates) is also in M (i.e., mortal). This is represented mathematically by the Venn diagram below:

\begin{tikzpicture}
    \draw (0,0) circle (2);
    \node at (-2,-2) {$M$};
    \draw (-1.5,-1.5) rectangle (0.5,-0.5);
    \node at (-1,-1) {$m$};
\end{tikzpicture}

In this diagram, the outer circle represents the set of all mortal things (M), and the smaller circle inside it represents the set containing Socrates (m). The intersection of the circles represents everything that is both mortal and contained in m, which is just Socrates himself.

