Here's an implementation of the requested decorator using NestJS:

```typescript
import { Injectable, NestMiddleware } from '@nestjs/common';
import { Observable } from 'rxjs';
import { map } from 'rxjs/operators';

@Injectable()
export class DevelopmentOnlyMiddleware implements NestMiddleware {
  constructor() {}

  use(req: any, res: any, next: () => Observable<any>): void | Observable<any> {
    const isDevelopment = process.env.NODE_ENV === 'development';

    if (isDevelopment) {
      return next().pipe(map(() => null));
    }

    return new Observable((observer) => observer.error({ status: 403, message: 'Forbidden in production environment.' }));
  }
}
```

To use this middleware, simply add it to your controller or route as follows:

```typescript
import { Controller } from '@nestjs/common';
import { DevelopmentOnly } from './development-only.decorator';

@Controller('api')
class ApiController {
  @Get()
  @DevelopmentOnly()
  get(): string {
    return 'Hello, World!';
  }
}
```

This decorator will only allow requests during development mode (`NODE_ENV=development`) and will return `null` after executing the controller action. For all other environments (production), it will return a `403 Forbidden` error.

