To create a more optimistic and grateful version, we can modify the function to prioritize certain letters and add words that promote positivity. Here's an updated implementation:

```swift
func rearrangePhraseForOptimismAndGratitude(_ phrase: String) -> String {
    let positiveWords = Set(["life", "happiness", "love", "joy", "blessings"])
    let gratefulLetters = Set("aeiou")

    let filteredPhrase = String(phrase.lowercased().filter {
        $0 != " " && (positiveWords.contains($0) || gratefulLetters.contains($0.lowercased().first!))
    })

    let sortedLetters = filteredPhrase.sorted { lhs, rhs in
        let lhsValue = lhs.firstIndex(of: "e") ?? filteredPhrase.count
        let rhsValue = rhs.firstIndex(of: "e") ?? filteredPhrase.count

        if lhsValue == rhsValue {
            let lhsLastVowel = lhs[String.Index(lhs.startIndex, offsetBy: filteredPhrase.range(of: "e")?.upperBound ?? filteredPhrase.endIndex, limitedBy: filteredPhrase.endIndex) ?? filteredPhrase.endIndex]
            let rhsLastVowel = rhs[String.Index(rhs.startIndex, offsetBy: filteredPhrase.range(of: "e")?.upperBound ?? filteredPhrase.endIndex, limitedBy: filteredPhrase.endIndex) ?? filteredPhrase.endIndex]

            return lhsLastVowel.unicodeScalars.last ?? Character(" ") > rhsLastVowel.unicodeScalars.last ?? Character(" ")
        } else {
            return lhsValue < rhsValue
        }
    }

    let newPhrase = String(sortedLetters)
    let ending = " brings \(newPhrase) and fills us with gratitude!"
    return ending
}
