To identify if a given sentence in Go contains a double negative, we can follow these steps:

1. Define a list of negative words that indicate negation. These words could be customized based on the context or language being analyzed. Here, we will consider some common English negative words.

2. Convert the input sentence to lowercase for case-insensitive comparison.

3. Split the converted sentence into an array of words using space as a delimiter.

4. Create a map called `negations` to store the negative words and their respective positions in the `negativeWords` slice. This helps us easily find the second negative (if present) in the sentence.

5. Loop through each word in the array and check if it is a negative word or "not". If it is a negative word, we check if there is another negative word after it or "not". If so, return true as we have identified a double negative.

6. Store the position of the first negative word encountered in the `firstNegativeIndex` variable.

7. If we encounter "not" after a negative word, we need to check if there is another negative word after "not". We do this by iterating over the remaining words from the position of the first negative plus one.

8. If we find another negative word after "not", we return true as we have found a double negative.

9. After all words have been checked, if we haven't found a double negative, return false.

Here's the Go implementation:

```go
package main

import "fmt"

// List of negative words
var negativeWords = []string{"n't", "no", "nor", "not"}

func hasDoubleNegative(sentence string) bool {
    // Convert to lowercase for case-insensitive comparison
    sentence = strings.ToLower(sentence)

    // Split into an array of words
    words := strings.Split(sentence, " ")

    // Map to store negative words and their positions
