Certainly! Here's an implementation of binary search in C++:

```cpp
int binarySearch(int arr[], int left, int right, int x) {
    while (left <= right) {
        int mid = left + (right - left) / 2;

        // Check if element is present at mid
        if (arr[mid] == x) {
            return mid;
        }

        // If element is smaller than mid, then it can only be present in left subarray
        if (arr[mid] > x) {
            right = mid - 1;
        }

        // Else element is larger than mid, so it can only be present in right subarray
        else {
            left = mid + 1;
        }
    }

    // Element was not found in array
    return -1;
}
```

This function takes four arguments: `arr` is the sorted array to search through, `left` and `right` define the range of indices to search within (inclusive), and `x` is the value being searched for. The function returns the index of the element if found, or -1 if not found.

The binary search algorithm works by repeatedly dividing the search interval in half until the target is found or the interval is empty. At each step, we compute the midpoint of the current search interval, compare the value at the midpoint with the target value, and recursively search the left or right half depending on whether the target is less than or greater than the midpoint value.

Here's how to use the function:

```cpp
int arr[] = { 2, 5, 8, 12, 19 };
int n = sizeof(arr) / sizeof(arr[0]);
int x = 12;
int result = binarySearch(arr, 0, n - 1, x);
if (result == -1) {
    cout << "Element is not present in array";
} else {
    cout << "Element found at index: " << result;
}
```

In terms of efficiency, binary search has a time complexity of O(log n) in the average and best cases, which makes it much faster than linear search (O(n))

